class SessionTracker{constructor(name){this.name=name}
store(){var now=Date.now();window.localStorage.setItem(this.name+"-lastauth",now)}
start(interval,timeout,renewFcn){var a=function(){var lastauth=window.localStorage.getItem(this.name+"-lastauth");var now=Date.now();if(now-lastauth>=timeout-(2*interval)){renewFcn();this.store()}}
var b=a.bind(this);window.setInterval(b,interval)}}
